import React from 'react';
import './Recents.css';
import { FaExternalLinkAlt, FaClipboard } from 'react-icons/fa';

const Recents = ({ projects }) => {
  return (
    <div className="recents-container">
      <h2>Recents</h2>
      {projects.length === 0 ? (
        <p>No recent projects available</p>
      ) : (
        <div className="recents-list">
          {projects.map((project) => (
            <div key={project.id} className="recent-item">
              <span>{project.name} â€¢ in Project Notes</span>
              <div className="project-icons">
                <button
                  className="icon-btn"
                  title="Open in new tab"
                  onClick={() => alert('Opening project in new tab...')}
                >
                  <FaExternalLinkAlt />
                </button>
                <button
                  className="icon-btn"
                  title="Copy link"
                  onClick={() => alert('Link copied!')}
                >
                  <FaClipboard />
                </button>
              </div>
            </div>
          ))}
          {projects.length > 0 && (
            <div className="recent-item">
              <span>Dashboard</span>
              <div className="project-icons">
                <button
                  className="icon-btn"
                  title="Open in new tab"
                  onClick={() => alert('Opening dashboard in new tab...')}
                >
                  <FaExternalLinkAlt />
                </button>
                <button
                  className="icon-btn"
                  title="Copy link"
                  onClick={() => alert('Link copied!')}
                >
                  <FaClipboard />
                </button>
              </div>
            </div>
          )}
        </div>
      )}
    </div>
  );
};

export default Recents;
